import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useEffect, useState } from 'react';
import { createOrder, allMedicines } from './api';

export default function Cart() {
  const navigate = useNavigate();
  const username = localStorage.getItem('username');
  const [error, setError] = useState(null);
  const [OrderTables, setOrderTables] = useState();
  const [Medicines, setMedicines] = useState([]);
  const [values, setValues] = useState(Medicines.map((med) => ({ ...med, quantity: 0 })));

  const goToProfile = () => {
    navigate('/profile'); // Путь к странице Cart.js
  };

  const handleQuantityChange = (id, event) => {
    const newValues = values.map((med) => {
      if (med.id === id) {
        return { ...med, quantity: parseInt(event.target.value) || 0 };
      }
      return med;
    });
    setValues(newValues);
  };

  const addValue = (id) => {
    const newValues = values.map((med) => {
      if (med.id === id) {
        return { ...med, quantity: med.quantity + 1 };
      }
      return med;
    });
    setValues(newValues);
  };

  const minusValue = (id) => {
    const newValues = values.map((med) => {
      if (med.id === id) {
        return { ...med, quantity: Math.max(med.quantity - 1, 0) };
      }
      return med;
    });
    setValues(newValues);
  };

  useEffect(() => {
    const handleNewOrder = async () => {
      try {
        const newOrder = await createOrder(username);
        setOrderTables(newOrder); // Добавьте новый заказ в список
        console.log(username);
        console.log(newOrder);
      } catch (error) {
        setError(`Ошибка при создании заказа: ${error.message}`);
      }
    }
    handleNewOrder();
    const showallMedicines = async () => {
      try {
        const medicine = await allMedicines();
        setMedicines(medicine);
      } catch (error) {
        setError(`Ошибка при выводе лекарств: ${error.message}`)
      }
    }
    showallMedicines();
  }, [username]);

  return (
    <div>
      <h1 className='heading'>Ваша Корзина</h1>
      <div className='container'>
        <ul>
          <table className='table'>
            <thead>
              <tr>
                <th>Название товара</th>
                <th>Цена</th>
                <th>Количество</th>
              </tr>
            </thead>
            {error ? (
              <tbody><p>{error}</p></tbody>
            ) : (
              values.map((med) => (
                <tbody key={med.id}>
                  <tr>
                    <td>{med.medicineid}</td>
                    <td>{med.price}</td>
                    <td>
                      <input
                        type="number"
                        value={med.quantity}
                        onChange={(event) => handleQuantityChange(med.id, event)}
                      />
                    </td>
                    <td className='td'>
                      <button onClick={() => addValue(med.id)}>+</button>
                      <button onClick={() => minusValue(med.id)}>-</button>
                    </td>
                  </tr>
                </tbody>
              ))
            )}
            <tfoot>
              <tr>
                <th scope="row" colSpan="3">Общая сумма: </th>
                <td>
                  <button className="btn" onClick={goToProfile}>
                    Оформить заказ
                  </button></td>
              </tr>
            </tfoot>

          </table>
        </ul>
      </div>
      <div className="navbar">
        <div className="thq-navbar-nav">
          <span>© Здоровье в корзине</span>
          <button className="back" onClick={goToProfile}>
            Назад в профиль
          </button>
        </div>
      </div>
    </div>
  )
}
